      gridXLength: 0,
      gridYLength: 0,

    }
  }

  determineArrayDimensions(){
    let yLengthTMP = this.state.gridArray.length;
    let xLengthTMP = this.state.gridArray.reduce((x, y) => Math.max(x, y.length), 0);
    console.log(xLengthTMP);
    console.log(yLengthTMP);
  }

  render(){
    this.determineArrayDimensions();
    return (

      <div className="App">
        <header className="App-header">
        </header>

        <body>
            <div className="GridDiv">
              { this.state.gridArray.map(Element => Element.map(Element2 => <h1>{Element2}</h1> )) }
            </div>

        </body>
      </div>
    );
  }

}

export default App;
